description:
Expect the set of distinct column values to contain a given set.

expect_column_distinct_values_to_contain_set is a     [Column Aggregate Expectation](https://docs.greatexpectations.io/docs/guides/expectations/creating_custom_expectations/how_to_create_custom_column_aggregate_expectations).

Column Aggregate Expectations are one of the most common types of Expectation.
They are evaluated for a single column, and produce an aggregate Metric, such as a mean, standard deviation, number of unique values, column type, etc.
If that Metric meets the conditions you set, the Expectation considers that data valid.

Args:
    column (str):             The column name.
    value_set (set-like):             A set of objects used for comparison.

Other Parameters:
    result_format (str or None):             Which output mode to use: BOOLEAN_ONLY, BASIC, COMPLETE, or SUMMARY.             For more detail, see [result_format](https://docs.greatexpectations.io/docs/reference/expectations/result_format).
    meta (dict or None):             A JSON-serializable dictionary (nesting allowed) that will be included in the output without             modification. For more detail, see [meta](https://docs.greatexpectations.io/docs/reference/expectations/standard_arguments/#meta).

Returns:
    An [ExpectationSuiteValidationResult](https://docs.greatexpectations.io/docs/terms/validation_result)

    Exact fields vary depending on the values passed to result_format and meta.

See Also:
    [expect_column_distinct_values_to_be_in_set](https://greatexpectations.io/expectations/expect_column_distinct_values_to_be_in_set)
    [expect_column_distinct_values_to_equal_set](https://greatexpectations.io/expectations/expect_column_distinct_values_to_equal_set)

Supported Datasources:
    [Snowflake](https://docs.greatexpectations.io/docs/application_integration_support/)
    [PostgreSQL](https://docs.greatexpectations.io/docs/application_integration_support/)

Data Quality Category:
    Sets

Example Data:
            test    test2
        0   1       1
        1   2       1
        2   4       1

Code Examples:
    Passing Case:
        Input:
            ExpectColumnDistinctValuesToContainSet(
                column="test",
                value_set=[1, 4]
            )

        Output:
            {
            "exception_info": {
                "raised_exception": false,
                "exception_traceback": null,
                "exception_message": null
            },
            "result": {
                "observed_value": [
                1,
                2,
                4
                ],
                "details": {
                "value_counts": [
                    {
                    "value": 1,
                    "count": 1
                    },
                    {
                    "value": 2,
                    "count": 1
                    },
                    {
                    "value": 4,
                    "count": 1
                    }
                ]
                }
            },
            "meta": {},
            "success": true
            }

    Failing Case:
